/* eslint-disable @next/next/no-img-element */
import { ImageResponse } from 'next/og';

export const runtime = 'edge';

export const contentType = 'image/png';

const RESUME_OG_DATA = {
    name: 'Patrick Lehmann',
    about: 'Frontend Developer',
    avatarUrl: 'https://avatars.githubusercontent.com/u/32590221?v=4',
    personalWebsiteUrl: 'https://ptrcklehmann.com',
} as const;

export const alt = 'Patrick Lehmann - Frontend Developer';
export const size = {
    width: 1200,
    height: 630,
};

export default async function Image() {
  const fontData = await fetch(new URL('../../assets/fonts/Geomanist-Medium.woff', import.meta.url)).then(
      res => res.arrayBuffer(),
  );
  return new ImageResponse(
      (
          <div
              style={{
                  background:
                      'url(data:image/jpeg;base64,)',
                  color: '#12191f',
                  backgroundPosition: 'top',
                  backgroundColor: 'rgba(255, 255, 255, 0.8)',
                  width: '100%',
                  height: '100%',
                  display: 'flex',
                  alignItems: 'center',
                  justifyContent: 'center',
                  fontFamily: 'Geomanist, sans-serif',
              }}
          >
              <div
                  style={{
                      display: 'flex',
                      flexDirection: 'column',
                      alignItems: 'center',
                      justifyContent: 'center',
                      textAlign: 'center',
                  }}
              >
                  <img
                      src={RESUME_OG_DATA.avatarUrl}
                      alt={RESUME_OG_DATA.name}
                      style={{
                          width: '200px',
                          height: '200px',
                          borderRadius: '50%',
                          marginBottom: '2rem',
                          filter: 'grayscale(100%)',
                      }}
                  />
                  <div
                      style={{
                          fontSize: '2.5rem',
                          fontWeight: '400',
                          textTransform: 'uppercase',
                          color: '#12191f',
                          background: '#f0f0f0',
                      }}
                  >
                      {RESUME_OG_DATA.name}
                  </div>
                  <div
                      style={{
                          fontSize: '1.8rem',
                          color: '#626262',
                          maxWidth: '600px',
                          background: '#f0f0f0',
                      }}
                  >
                      {RESUME_OG_DATA.about}
                  </div>
                  <div
                      style={{
                          display: 'flex',
                          marginTop: '2rem',
                          gap: '1rem',
                          background: '#f0f0f0',
                      }}
                  >
                      {RESUME_OG_DATA.personalWebsiteUrl && (
                          <div style={{ fontSize: '1.2rem', color: '#626262' }}>
                              {RESUME_OG_DATA.personalWebsiteUrl.slice(8)}
                          </div>
                      )}
                  </div>
              </div>
          </div>
      ),
      {
          ...size,
          fonts: [
              {
                  data: fontData,
                  name: 'Geomanist Bold',
                  style: 'normal',
                  weight: 700,
              },
          ],
      },
  );
}
